import React from "react";
import { Route } from "react-router-dom";
import CustomerApp from "../../digiTenderFrontend1/src/customerApp";
import SupplierApp from "../../digiTenderFrontend1/src/supplierApp";
import AdminApp from "../../digiTenderFrontend1/src/AdminApp";

function App() {
  return (
    <div>
      <Route path="/customer" component={CustomerApp} />
      <Route path="/supplier" component={SupplierApp} />
      <Route path="/admin" component={AdminApp} />
    </div>
  );
}

export default App;
